const CreateTask = ({ onClick }) => {
    return(
        <div className="card task-summary">
            <div className="card-content black-text text-darken-3">
                <label htmlFor={'title'}>Title</label>
                <input type={'text'} name={'title'} />
                <a className="btn-floating btn-small waves-effect waves-light red"><i className="material-icons">add</i></a>
                <button onClick={ () => onClick({title: 'new task!'})}>yooooo</button>
            </div>
        </div>
    );
}

export default CreateTask
